import React from 'react'
import Product from './Product'
import ztw_dadant from '../Pictures/ztw_dadant.png'

function Frames() {
    return (
        <div className='store__frames'>

            <Product
                id='ztw_wlkp_gnizd'
                title='Zatwór wielkopolski gniazdowy zwykły'
                image='http://skleppszczelarskiramka.pl/wp-content/uploads/2018/02/przegroda-pionowa-wielkopolska-drewniana1.jpg'
                price={6}
                availble={true}
            />
            <Product
                id='ztw_wlkp_gnizd_ocpl'
                title='Zatwór wielkopolski gniazdowy ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={12}
                availble={false}
            />



            <Product
                id='ztw_wlkp_18'
                title='Zatwór wielkopolski 18 zwykły'
                image='http://skleppszczelarskiramka.pl/wp-content/uploads/2018/02/przegroda-pionowa-wielkopolska-drewniana1.jpg'
                price={5.5}
                availble={false}
            />
            <Product
                id='rgl_wlkp_18_ocpl'
                title='Zatwór wielkopolski 18 ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={10}
                availble={false}
            />



            <Product
                id='ztw_wlkp_1/2'
                title='Zatwór wielkopolski 1/2 zwykły'
                image='http://skleppszczelarskiramka.pl/wp-content/uploads/2018/02/przegroda-pionowa-wielkopolska-drewniana1.jpg'
                price={5.5}
                availble={false}
            />
            <Product
                id='ztw_wlkp_1/2_ocpl'
                title='Zatwór wielkopolski 1/2 ocieplany'
                image='http://skleppszczelarskiramka.pl/wp-content/uploads/2018/02/przegroda-pionowa-wielkopolska-drewniana1.jpg'
                price={10}
                availble={false}
            />



            <Product
                id='ztw_wrsz'
                title='Zatwór warszawski zwykły'
                image='http://skleppszczelarskiramka.pl/wp-content/uploads/2018/04/przegroda-warszawska-zwykla-drewniana1.jpg'
                price={7.5}
                availble={false}
            />
            <Product
                id='ztw_wrsz_ocpl'
                title='Zatwór warszawski ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={12}
                availble={false}
            />

            <Product
                id='ztw_wrsz_pszrz'
                title='Zatwór warszawski poszerzany'
                image='http://skleppszczelarskiramka.pl/wp-content/uploads/2018/06/przegroda-warszawska-poszerzana-pionowa-drewniana1.jpg'
                price={9}
                availble={false}
            />

            <Product
                id='ztw_wrsz_pszrz_ocpl'
                title='Zatwór warszawski poszerzany ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={14}
                availble={false}
            />

            <Product
                id='ztw_dadant'
                title='Zatwór dadant zwykły'
                image={ztw_dadant}
                price={10}
                availble={false}
            />

            <Product
                id='ztw_dadant_ocpl'
                title='Zatwór dadant ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={14}
                availble={false}
            />

            <Product
                id='ztw_lngs_1/1'
                title='Zatwór langstroth 1/1 zwykły'
                image='http://skleppszczelarskiramka.pl/wp-content/uploads/2018/04/przegroda-pionowa-dadant-drewniana1.jpg'
                price={10}
                availble={false}
            />

            <Product
                id='ztw_lngs_1/1_ocpl'
                title='Zatwór langstroth 1/1 ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={14}
                availble={false}
            />

            <Product
                id='ztw_styr'
                title='Zatwór styropianowy'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={14}
                availble={false}
            />

        </div>
    )
}

export default Frames
